import "./App.css";
import styled from "styled-components";
import { AccountBox } from "./components/accountBox";
import VideoWebBackground from "./video/shopping online - video background for WebSite.mp4"

const AppContainer = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`;

function App() {
    return (
        <>
            <AppContainer>
                <AccountBox />
            </AppContainer>

            <div ClassName="banner">
                <video autoplay loop muted
                >
                    <source src={VideoWebBackground} type="video/mp4"></source>
                </video>
            </div>
        </>

    );
}

const Features = () => {
    <div ClassName="banner">
        <video autoplay loop muted
        >
            <source src={VideoWebBackground} type="video/mp4"></source>
        </video>
    </div>

}

export default App;
